window.bookSummaryJSON = "<p>The human race has become nearly extinct.&nbsp;</p> <p>Allistor and his small group push to make themselves stronger, fighting to survive the year-long stabilization.&nbsp;</p> <p>Forced to battle increasingly stronger and more deadly monsters, they work to expand their holdings, learn better spells, and gather resources to improve their crafting.&nbsp;</p> <p>Dungeons must be cleared, and dragons defeated. Fellow survivors are found - some friendly, some hostile.&nbsp;&nbsp;</p> <p>Allistor considers every human life precious, but when it becomes a case of kill or be killed, hard choices must be made.&nbsp;</p> <p>And each day brings them closer to the invasion of Earth.&nbsp;</p> <p>The Soundbooth Theater team for this production:</p> <ul> <li>Will Watt - Narration</li> <li>Annie Ellicott - Amanda, Meg, and other supporting characters</li> <li>Andrea Parsneau - Helen, Andrea, and the rest of the female cast</li> <li>Jeff Hays - Austin, Ramon, Fuzzy, and other supporting characters</li> <li>Richard Smith - Proofing</li> <li>Griffin Malnar - Editing and mastering</li> <li>Ahmed Mahmoud - Sound design and music</li> </ul>"; 
